hwMeta.bodyText:
If((lookupResRead & (tables_0_lookupRes_vld & tables_1_lookupRes_vld))._eq(1),
    If((tables_0_lookupRes_found | tables_1_lookupRes_found)._eq(1),
        insertTargetOH_next(Concat(tables_1_lookupRes_found, tables_0_lookupRes_found))
    ).Elif((~tables_0_lookupRes_occupied)._eq(1),
        insertTargetOH_next(1)
    ).Elif((~tables_1_lookupRes_occupied)._eq(1),
        insertTargetOH_next(2)
    ).Elif(insertTargetOH != 0,
        insertTargetOH_next(Concat(sig_0, sig_1))
    ).Else(
        insertTargetOH_next(2)
    ),
    insertFinal_next(tables_0_lookupRes_found | tables_1_lookupRes_found | ~tables_0_lookupRes_occupied | ~tables_1_lookupRes_occupied)
).Else(
    insertTargetOH_next(insertTargetOH),
    insertFinal_next(insertFinal)
)

Switch(insertFsm)\
    .Case(insertFsm_t.idle,
        If(lookup_not_in_progress & clean_vld._eq(1),
            insertFsm_next(insertFsm_t.cleaning)
        ).Elif(lookup_not_in_progress & (insert_vld | delete_vld)._eq(1),
            insertFsm_next(insertFsm_t.lookup)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.cleaning,
        If((tables_0_insert_rd & tables_1_insert_rd)._eq(1) & cleanupAddr._eq(15),
            insertFsm_next(insertFsm_t.idle)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.lookup,
        If(stash_reinsert_cntr._eq(0) & stash_origin_op._eq(ORIGIN_TYPE.INSERT) & insertRes_rd._eq(1),
            insertFsm_next(insertFsm_t.idle)
        ).Elif(((stash_reinsert_cntr != 0) | ~(stash_origin_op._eq(ORIGIN_TYPE.INSERT))) & (tables_0_lookup_rd & tables_1_lookup_rd)._eq(1),
            insertFsm_next(insertFsm_t.lookupResWaitRd)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Case(insertFsm_t.lookupResWaitRd,
        If((tables_0_lookupRes_vld & tables_1_lookupRes_vld)._eq(1),
            insertFsm_next(insertFsm_t.lookupResAck)
        ).Else(
            insertFsm_next(insertFsm)
        ))\
    .Default(
        If(stash_origin_op._eq(ORIGIN_TYPE.DELETE),
            insertFsm_next(insertFsm_t.idle)
        ).Elif((tables_0_insert_rd & tables_1_insert_rd & insertFinal)._eq(1) & (stash_origin_op._eq(ORIGIN_TYPE.DELETE) | insertRes_rd._eq(1)),
            insertFsm_next(insertFsm_t.idle)
        ).Elif((tables_0_insert_rd & tables_1_insert_rd & ~insertFinal)._eq(1),
            insertFsm_next(insertFsm_t.lookup)
        ).Else(
            insertFsm_next(insertFsm)
        ))

If((lookup_rd & lookup_vld & ~(lookupRes_rd & lookupRes_vld))._eq(1),
    lookup_in_progress_next((lookup_in_progress._reinterpret_cast(Bits(4, signed=False)) + 1)._reinterpret_cast(Bits(4)))
).Elif((~(lookup_rd & lookup_vld) & (lookupRes_rd & lookupRes_vld))._eq(1),
    lookup_in_progress_next((lookup_in_progress._reinterpret_cast(Bits(4, signed=False)) - 1)._reinterpret_cast(Bits(4)))
).Else(
    lookup_in_progress_next(lookup_in_progress)
)
